import React from "react";
import { useNavigate } from "react-router-dom";

export default function UserDashboard() {
  const navigate = useNavigate();

  return (
    <div className="p-4 bg-gray-900 text-white rounded-md">
      <h2 className="text-xl font-bold mb-4">User Dashboard</h2>
      <div className="flex flex-col gap-3">
        {/* âœ… Fixed paths: Removed leading `/` to make paths relative */}
        <button onClick={() => navigate("all-news")} className="p-2 bg-blue-600 rounded-md">
          View All News
        </button>
        <button onClick={() => navigate("personalized-news")} className="p-2 bg-green-600 rounded-md">
          View Personalized News
        </button>
      </div>
    </div>
  );
}
